import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// import Navbar from 'react-bootstrap/Navbar';
// import Form from 'react-bootstrap/Form';
// import Button from 'react-bootstrap/Button';
// import Nav from 'react-bootstrap/Nav';

import {
    NavLink,
    HashRouter
} from "react-router-dom";

function ReactNavbar(props){
    return(
        <HashRouter>
            <nav className="navbar navbar-inverse">
                <div className="container-fluid">
                    <div className="navbar-header">
                        <a className="navbar-brand" href="#">WebSiteName</a>
                    </div>
                    <ul className="nav navbar-nav">
                        {
                            props.routes.map((value, index) => (
                                <li key={index}>
                                    <NavLink to={`${value['route']}`}>
                                        {value['name']}
                                    </NavLink>
                                </li>
                            ))
                        }
                    </ul>
                </div>
            </nav>
            {/* <Navbar bg="dark" variant="dark" className="navbar">
                <Navbar.Brand href="/">Navbar</Navbar.Brand>
                <Nav className="mr-auto nav navbar-nav" >
                        {props.routes.map((value, index) => (
                            <li key={index}><NavLink to={`${value['route']}`}>{value['name']}</NavLink></li>
                        ))
                        }
                </Nav>
                
                <Form inline>
                    <Button variant="outline-light">Username</Button>
                </Form>
                
            </Navbar> */}
            
        </HashRouter>
    );
}

export default ReactNavbar;
